window.App.Ctrls.controller("PCCtrl", ["$scope", "$rootScope", "$sce", "$interval", "$http", "$uibPosition", "blockUI",

function($scope, $rootScope, $sce, $interval, $http, $position, blockUI) {

$rootScope.PC = {};
$rootScope.PC.ABView = true;
$rootScope.App.CurrentView = "PC";

window.App.PC = {};
window.App.PC.Scope = $scope;

$scope.Button2Click = function($event) {
$rootScope.Button2.Event = $event;

window.App.Debugger.log("Start of Button2 Click event", "info", -1);

window.App.Debugger.log("HttpSetData \x22NameToASCII\x22 \x22EngName\x22 \x22[engname1.Value]\x22", "info", 1);

$rootScope.NameToASCII.Request.data["EngName"] = $rootScope.engname1.Value;

window.App.Debugger.log("HttpSetData \x22NameToASCII\x22 \x22AdmPD\x22 \x22[passwd1.Value]\x22", "info", 2);

$rootScope.NameToASCII.Request.data["AdmPD"] = $rootScope.passwd1.Value;

window.App.Debugger.log("HttpExecute \x22NameToASCII\x22", "info", 3);


$rootScope.NameToASCII.Execute();

window.App.Debugger.log("End of Button2 Click event", "info", -2);

};

$rootScope.NameToASCII.Execute = function() {
  if ($rootScope.NameToASCII.Transform == "json") {
    $rootScope.NameToASCII.Request.transformRequest = function(data) {return JSON.stringify(data)};
  } else if ($rootScope.NameToASCII.Transform == "data") {
    $rootScope.NameToASCII.Request.transformRequest = function(data) {var frmData = new FormData(); angular.forEach(data, function(value, key) { frmData.append(key, value); }); return frmData;};
  }
  $http($rootScope.NameToASCII.Request)
  .then(function(response) {
    $rootScope.NameToASCII.Status = response.status;
    $rootScope.NameToASCII.Response = response.data;
    $rootScope.NameToASCII.StatusText = response.statusText;

window.App.Debugger.log("Start of NameToASCII Success event", "info", -1);

window.App.Debugger.log("ObjectGetProp \x22[NameToASCII.Response]\x22 \x22RetASCII\x22 \x22[ret_ASCII]\x22", "info", 1);

$rootScope.ret_ASCII = $rootScope.NameToASCII.Response["RetASCII"];

window.App.Debugger.log("ObjectGetProp \x22[NameToASCII.Response]\x22 \x22Name\x22 \x22[ret_Name]\x22", "info", 2);

$rootScope.ret_Name = $rootScope.NameToASCII.Response["Name"];

window.App.Debugger.log("InputBox \x22The PassWd of [ret_Name] is:\x22 \x22OK\x22 \x22[ret_ASCII]\x22 \x22success\x22 \x22CopyToClipboard\x22", "info", 3);

$scope.inputBox("The PassWd of "+$rootScope.ret_Name+" is:", "OK", $rootScope._InputBoxModalResult, $rootScope.ret_ASCII, "success", (("CopyToClipboard".length > 0) && angular.isFunction($scope["CopyToClipboard"])) ? $scope["CopyToClipboard"] : null);

window.App.Debugger.log("End of NameToASCII Success event", "info", -2);

  },
  function(response) {
    $rootScope.NameToASCII.Status = response.status;
    $rootScope.NameToASCII.Response = response.data;
    $rootScope.NameToASCII.StatusText = response.statusText;

window.App.Debugger.log("Start of NameToASCII Error event", "info", -1);

window.App.Debugger.log("AlertBox \x22Get ASCII by EngName failed!\x22 \x22warning\x22", "info", 1);

$scope.alertBox("Get ASCII by EngName failed!", "warning");

window.App.Debugger.log("End of NameToASCII Error event", "info", -2);

  });
};

}]);

